import React, { Component } from 'react';
import Clarifai from 'clarifai';
import Navigation from './Components/Navigation/Navigation';
import Logo from './Components/Logo/Logo';
import ImageLinkForm from './Components/ImageLinkForm/ImageLinkForm';
import Rank from './Components/Rank/Rank'
import FaceRecognition from './Components/FaceRecognition/FaceRecognition';
import Particles from 'react-particles-js';

import './App.css';

const app = new Clarifai.App({
	apiKey: '46cd60645f2f41178e02fc35b1ad7ed7'
})

const particleOptions = {
	particles: {
		number: {
			value: 30,
		density: {
			enable: true,
			value_area: 800,
		}
	}
}
}

class App extends Component {
	constructor() {
		super();
		this.state = {
			input: '',
			imageUrl: ''
		}
	} 


onInputChange = (event) => {
	this.setState({input: event.target.value});
}

// To get the value of the input, you need to use the above code in the console.log paramaters

helloThere = () => {
	this.setState({imageUrl: this.state.input});
		app.models.predict(Clarifai.COLOR_MODEL, this.state.input).then(
	    	function(response) {
	      		console.log(response);
	   	 },
	   		function(err) {
	      		// there was an error
	    }
  );
}


render() {
	return (
		<div className="App">
			 <Particles className='Particles1'
			 	params={particleOptions}
			 />
			 <Navigation />
			 <Logo />
			 <Rank />
			 <ImageLinkForm onInputChange={this.onInputChange} helloThere={this.helloThere}/> 
		     <FaceRecognition imageUrl={this.state.imageUrl}/>
		</div>
	);
}
}

export default App;


 // For onInputChange to work, you have to use this. as it is a property of the app, otherwise it is undefined and will not register.
